import React from 'react';

import { InputLabel, TextField } from '@mui/material';

const CustomTextField = (props) => {
  const { name, isRequired } = props;
  return (
    <TextField
      style={{
        backgroundColor: 'white'
      }}
      required={isRequired}
      variant='filled'
      placeholder={name}
      label={name + '...'}/>
  )
}

export default CustomTextField;
